  ["|cff33ffccBlizzard: \"Interface Options\"|r\n\nDo you want me to setup the recommended blizzard UI settings?\nThis will enable settings that can be found in the Interface section of your client.\nOptions like Buff Durations, Instant Quest Text, Auto Selfcast and others will be set."] = = "Voulez-vous que le logiciel vous paramètre les options d'interface recommandées ?\nSi oui, celà va activer les diverses options qui se trouvent dans la partie interface de votre client.\nLes options comme la durée des améliorations, la lecture de quête instantanée, l'autosélection et d'autres vont être activées.",
  ["|cff33ffccChat: \"Channels\"|r\n\nDo you want me to setup the chat channels of your chatframes?\nThis would set important or personal messages to the left chat\nand world channels and lootinformation to the right chat."] = "Voulez-vous que le logiciel vous paramètre les canaux de discussion dans votre fenêtre de chat ? \nEn faisant ceci, les messages de chat seront disposés à gauche, alors que les textes de butin ou autre seront affichés sur la partie droite de l'écran.",
  ["|cff33ffccChat: \"Layout\"|r\n\nDo you want me to adjust the layout of your chatframes?\nThis would make sure, that every window is placed on its dedicated position."] = "Voulez-vous que le logiciel vous paramètre les caratéristiques de la fenêtre de discussion ?\n Ceci permet d'optimiser et de placer correctement les fenêtres."
  ["|cff33ffccChat: \"Loot & Spam\"|r\n\nDo you want me to create and manage a specific Chatframe called \"Loot & Spam\"?\nThis chat will display world channels, loot information and miscellaneous messages,\nthat would otherwise clutter your main chatframe."] = "Voulez-vous que le logiciel vous installe une fenêtre de dialogue nommée \"Butin & Spam\"?\nCette fenêtre affichera les messages du canal Monde, les informations du butin et divers messages,\nceci va permettre d'alléger votre fenêtre principale de chat pour plus de lisibilité."
  ["|cff33ffccKeybind Mode|r\nThis mode allows you to bind keyboard shortcuts to your actionbars.\nBy hovering a button with your cursor and pressing a key, the key will be assigned to that button.\nHit Escape on a button to remove bindings.\n\nPress Escape or click on an empty area to leave the keybind mode."] = "L'activation de ce mode permet de facilement attribuer une touche de clavier ou de la souris pour un sort dans votre barre d'action.\n En plaçant la souris sur un sort et en appuyant sur la touche souhaitée, vous pouvez attribuer ce dernier au sort.\nAppuyez sur Echap pour supprimer le raccourci.\n\nAppuyez sur Echap ou cliquez sur une zone vide pour quitter le mode Attribution de touche.",
  ["|cff33ffccUnlock Mode|r\nThis mode allows you to move frames by dragging them using the mouse cursor. Frames can be scaled by scrolling up and down.\nTo scale multiple frames at once (eg. raidframes), hold down the shift key while scrolling. Click into an empty space to go back to the pfUI menu."] = "Ce mode va vous permettre de déplacer les fenêtres du jeu avec un glisser-déposer de la souris. Vous pouvez augmenter la taille des fenêtres en utilisant la molette de la souris vers haut ou vers le bas pour diminuer la taille.\nPour faire varier la taille de plusieurs fenêtres en même temps (par exemple les fenêtres de Raid), maintenez enfoncé la touche Shift de votre clavier tout en utilisant la molette de la souris (vers le haut ou vers le bas).\n Cliquez sur une zone vide pour quitter ce mode d'édition.",
